import React from "react";

function Input(props){
    return(
    <input 
    type={props.type} 
    className={props.className} 
    placeholder={props.placeholder}
    onChange={props.onChange} 
    value={props.value} 
    id={props.id} 
    name={props.name} />
    );
};

export default Input;
